// Team Component
const Team = ({ team }) => {
    return (
        <div>
            <h2>{team.teamName}</h2>
            {team.roster.map(player =>
                <p key={player.id}>{player.name} - TRADE VALUE: {player.tradeValue}</p>
            )}
        </div>
    );
}
